oxy_webhelp_navlinks = {"desktop_private_client_workspace-d7520e984":{"topics":[{"title":"Desktop workspace UI page for Retail Client","shortdesc":"<p class=\"shortdesc\">Desktop workspace for Retail Client is a desktop GUI page that is opened as Retail         Clients login to the internet banking application. <\/p>","href":"topics\/privat_clients_ui_workspace.html","attributes":{"data-id":"privat_clients_ui_workspace"},"menu":{"hasChildren":false},"tocID":"privat_clients_ui_workspace-d7520e992","next":"privat_clients_ui_workspace-d7520e992"},{"title":"Desktop tasks UI pages for Retail Clients","shortdesc":"<p class=\"shortdesc\">Clients handle internet banking operations within specially designed UI pages. Those         banking operations we considered for Tasks. Changing card pin code, making new payment,         setting payment orders etc. are banking Tasks. Usually to gain a result you need to pass         some steps. To ease handling all task steps, special UI page is created.<\/p>","href":"topics\/privar_clients_tasks_ui_pages.html","attributes":{"data-id":"privar_clients_tasks_ui_pages"},"menu":{"hasChildren":false},"tocID":"privar_clients_tasks_ui_pages-d7520e1044","next":"privar_clients_tasks_ui_pages-d7520e1044"},{"title":"Desktop UI controls for Retail Clients","shortdesc":"<p class=\"shortdesc\">UI control is a visual representative of  a task's step. Drop down menu, buttons,         fields etc. are UI controls. UI controls are usually connected to software application         source code steps (functions) and data.<\/p>","href":"topics\/privar_clients_steps_ui_controles.html","attributes":{"data-id":"privar_clients_steps_ui_controles"},"menu":{"hasChildren":false},"tocID":"privar_clients_steps_ui_controles-d7520e1238","next":"privar_clients_steps_ui_controles-d7520e1238"}]}};